import React, { useEffect, useState } from 'react';

const Reportes = () => {
  const [reportes, setReportes] = useState([]);
  const [graficoUrl, setGraficoUrl] = useState(null);

  const filtros = {
    fecha_desde: null,
    fecha_hasta: null,
    patente: null,
    tipo_mantencion: null,
    proveedor: null
  };

  useEffect(() => {
    fetch('http://localhost:8000/reportes/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(filtros)
    })
      .then(res => res.json())
      .then(data => {
        if (Array.isArray(data)) {
          setReportes(data);
        } else {
          console.warn('Respuesta inesperada:', data);
          setReportes([]);
        }
      })
      .catch(err => console.error('Error cargando reportes:', err));
  }, []);

  const handleDescargarExcel = () => {
    const url = new URL('http://localhost:8000/reportes/');
    url.searchParams.append('exportar_excel', 'true');

    fetch(url, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(filtros),
    })
      .then(response => response.blob())
      .then(blob => {
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.download = 'reporte_mantenciones.xlsx';
        link.click();
      })
      .catch(err => console.error('Error al descargar Excel:', err));
  };

  const handleVerGrafico = () => {
    const url = new URL('http://localhost:8000/reportes/');
    url.searchParams.append('generar_grafico', 'true');

    fetch(url, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(filtros),
    })
      .then(response => response.blob())
      .then(blob => {
        const imageUrl = URL.createObjectURL(blob);
        setGraficoUrl(imageUrl);
      })
      .catch(err => console.error('Error al generar gr√°fico:', err));
  };

  return (
    <div className="p-6 w-full max-w-5xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">üìä Historial y Reportes</h2>

      <div className="mb-6 space-x-4">
        <button
          onClick={handleDescargarExcel}
          className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
        >
          üì• Descargar Excel
        </button>
        <button
          onClick={handleVerGrafico}
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          üìà Ver Gr√°fico
        </button>
      </div>

      {graficoUrl && (
        <div className="mb-6">
          <h3 className="text-lg font-semibold mb-2">Gr√°fico de Costos</h3>
          <img src={graficoUrl} alt="Gr√°fico de costos por tipo de mantenci√≥n" className="rounded shadow" />
        </div>
      )}

      {reportes.length === 0 ? (
        <p>No hay reportes disponibles.</p>
      ) : (
        <ul className="space-y-2">
          {reportes.map((r) => (
            <li key={r.id} className="bg-white p-4 rounded shadow text-left">
              <p><strong>üöó Patente:</strong> {r.vehiculoPatente}</p>
              <p><strong>üîß Tipo:</strong> {r.tipoMantencion}</p>
              <p><strong>üè≠ Proveedor:</strong> {r.proveedor}</p>
              <p><strong>üìÖ Fecha:</strong> {r.fecha}</p>
              <p><strong>üí∞ Costo:</strong> ${r.costo}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Reportes;
